description:
SỔ ĐỎ 48M2, 2 MẶT THOÁNG
MẶT TIỀN RỘNG 45M;
 NGÕ SH QUAY COMPA;
50M RA HỒ CÔNG VIÊN TUỔI TRẺ, Ô TÔ TRÁNH;
9,3 TỶ
- Nhà bán khu vực dân trí cao, 2 mặt thoáng, gần Hồ Công viên tuổi trẻ, bãi đỗ xe ô tô, trong phạm vi 2km là các Trường Đại học Bách - Kinh - Xây, Bệnh viện Bạch Mai...
- Nhà thiết kế 3,5 tầng, đầy đủ công năng: phòng khách, bếp, phòng thờ, 3 phòng ngủ, vệ sinh, sân phơi.
- Nhà mặt tiền rộng 4,5n, có sân riêng để xe, tiểu cảnh.
Sổ đỏ đẹp 48m2, sẵn sàng giao dịch
